import React, { useState } from "react";
import {Tabs,Tab,Button,Box,TabPanel} from "@material-ui/core";


export default function Home()
{
    return (
      <Box
      sx={{ flexGrow: 1, bgcolor: 'background.paper', display: 'flex', height: "10%"}}
    >
      <Tabs
        orientation="vertical"
        variant="scrollable"
        aria-label="Vertical tabs example"
        sx={{ borderRight: 1, borderColor: 'divider' }}
      >
        <Tab label="Item One" />
        <Tab label="Item Two"  />
        <Tab label="Item Three"  />
        <Tab label="Item Four" />



      </Tabs>

    </Box>
  );
}
